+      : group_id_(group_id) {
+    for (const PQGroup &pq_group : PQGroups()) {
+      if (group_id == pq_group.group_id) {
+        ec_nid_ = pq_group.ec_nid;
+        pq_nid_ = pq_group.pq_nid;
+        break;
+      }
+    }
+  }
